  true,\n\t\"url\": null,\n\t\"notes\": \"BikeBaltimore is the Department of Transportationu2019s
  bike program. Managed by the Planning Section, BikeBaltimore includes anything bike
  related including implementing the Bicycle Master Plan, incorporating cycling in
  many transportation projects, installing bike racks and coordinating cycling events.
  The Bicycle Master Plan was developed by the Department of Planning in 2006. With
  the implementation of the Bicycle Master Plan, more bike facilities are appearing
  on city streets. There are many different types of bike facilities. Bike Lane: an
  area designated for bike travel only. The bike lane is a 5u2019 wide lane with a
  bike symbol indicating that only bikes should use that lane, Sharrow: A roadway
  which is shared by bikes and automobiles. Cars should treat bikes as vehicles in
  the lane and pass when it is safe to do so, Signed Route: A roadway with no pavement
  markings, signed routes are used on low-traffic volume streets where cyclists can
  u201ctake the laneu201d. Cars should pass bikes when it is safe to do so. Signed
  routes typically have mileage and destination markers with route adjustments along
  the way, Floating Bike Lane: Used along off-peak temporary parking, floating bike
  lanes adjust to the presence of parked cars. If parked cars are not present, cyclists
  occupy the 5u2019 bike lane along the curb. When parked cars are present, the cyclist
  travels in the designated area between the parked cars and vehicular travel lanes,
  Share The Road: When space does not exist for bike lanes, u201cSHARE THE ROADu201d
  signs are installed to remind motorists that cyclists may be present. Here cyclists
  are encouraged to use the shoulder of the road, or travel to the right while avoiding
  u201cdoor zonesu201d and roadside hazards, Shared Bus & Bike Lanes: On Pratt St,
  these lanes are only available to buses, bicycles and right turning vehicles\",\n\t\"license_title\":
